import React, { useState } from 'react';

export default function UsuarioCreateForm() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    cpf: '',
    email: '',
    senha: '',
    celular: '',
    cidade: '',
    estado: '',
  });

  const [submitStatus, setSubmitStatus] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    fetch('http://localhost:3030/usuarios/new', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData),
      redirect: 'follow',
    })
      .then((res) => {
        if (!res.ok) throw new Error('Erro ao criar usuário');
        return res.text();
      })
      .then((result) => {
        setSubmitStatus('Usuário criado com sucesso');
        console.log(result);
      })
      .catch((err) => {
        setSubmitStatus('Erro ao criar usuário');
        console.error(err);
      });
  };

  return (
    <div className="container mt-4">
      <h2>Criar Novo Usuário</h2>

      {submitStatus && <div className="alert alert-info">{submitStatus}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Primeiro Nome</label>
          <input type="text" className="form-control" name="firstName" value={formData.firstName} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">Último Nome</label>
          <input type="text" className="form-control" name="lastName" value={formData.lastName} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">CPF</label>
          <input type="text" className="form-control" name="cpf" value={formData.cpf} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">Email</label>
          <input type="email" className="form-control" name="email" value={formData.email} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">Senha</label>
          <input type="password" className="form-control" name="senha" value={formData.senha} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">Celular</label>
          <input type="text" className="form-control" name="celular" value={formData.celular} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">Cidade</label>
          <input type="text" className="form-control" name="cidade" value={formData.cidade} onChange={handleChange} required />
        </div>

        <div className="mb-3">
          <label className="form-label">Estado</label>
          <input type="text" className="form-control" name="estado" value={formData.estado} onChange={handleChange} required />
        </div>

        <button type="submit" className="btn btn-success">Criar Usuário</button>

        <button type="reset" className="btn btn-secondary ms-2" onClick={() => setFormData({
          firstName: '',
          lastName: '',
          cpf: '',
          email: '',
          senha: '',
          celular: '',
          cidade: '',
          estado: '',
        })}>
          Limpar Formulário
        </button>

      </form>
    </div>
  );
}
